import { BrowserRouter, Route, Routes } from 'react-router-dom'
import Header from './components/Header.js'
import Merch from './pages/merch';

const App = () => {
  return (
    <BrowserRouter>
      <Header />
      <Routes>
        <Route exact path='/Merch' component={Merch}>
          </Route>
          </Routes>

    </BrowserRouter>

  )
}

export default App
